Este poema es un soneto satírico muy conocido de Francisco de Quevedo, poeta español del Siglo de Oro que vivió entre 1580 y 1645, por lo tanto, en el siglo XVII. El poema "A una nariz" es una burla ingeniosa y humorística sobre una nariz desproporcionadamente grande.
